import React from "react";

const styles = {
    photo: {
        maxHeight: 170
    }
}

const Photo = props => (
    <li className="row">
        <img src={props.url} alt="#" className="col-lg-2 col-md-2 col-sm-3 col-xs-4" style={styles.photo}></img>
    </li>
);

export default Photo;
